import React from 'react';
import CreatePrison from './CreatePrison';
import EmployerHome from './EmployerHome';

class EmployerHOC extends React.Component {
  constructor(props) {
    super(props);
  };

  componentDidMount() {
    if (this.props.prisonInfo == undefined) {
      console.log("componentDidMount() invoked in EmployerHOC.js")
      const id = localStorage.getItem('userId')
      this.props.getPrisonInfo(id)
    }
  };

  render() {
    if (this.props.prisonId >= 1) {
      return <CreatePrison />
    } else {
      return <EmployerHome prisonInfo={this.props.prisonInfo} prisoners={this.props.prisoners}/>
    }
  }
};

export default EmployerHOC;
